Si torna dal corso istruttori tenuto dal Mestre @federico_tisi nell HQ Tribe a Milano @thunder_milano_.
Due giorni di corsi Gi e NoGi e di approffondimenti e miglioramenti, perché la formazione deve essere un processo continuo e incessante, senza mai fermarsi nel voler apprendere e migliorare.
Per questo ringraziamo il Mestre che è il meglio che ci sia ed è grazie al suo continuo studio e impegno che questa accaddemia cresce con miglioramenti esponenziali. 
Importantissimo avere sempre colleghi e soprattutto amici nelle vicinanze con supporto continuo
